import math
def stringmatch(a, b):
    def decode(i):
        return i % n 
    def is_equal(a, b, start):
        j = start
        for i in range(0, k):
            if a[decode(j)] != b[i]:
                return False
            j += 1
        return True
    global n 
    n = len(a)
    global k
    k = len(b)

    for i in range(n):
        if a[i] == b[0] and is_equal(a , b, i):
                return math.ceil((i + k) / n)                 
    return -1

def repeatedStringMatch( a: str, b: str) -> int:
        n = math.ceil(len(b) / len(a))
        if b in a:
            return 1
        if b in a * n:
            return n
        if b in a * (n + 1):
            return n + 1
        else:
            return -1

a = ""
b = ""
print(stringmatch(a, b))
print(repeatedStringMatch(a,b))